   //managing clients should be in registeration contract , and here we can import the contract and use its functions  // done by eman herawy

    constructor(AtaaToken _attaToken, YallaGiveAdmins _yallaAdmin , Registration _registration) public {
        owner = msg.sender;
        attaToken = _attaToken;
        YgAdmins = _yallaAdmin;
