  // any charity should call increaseAllowance and add this contract address  with the amount of attacoin first 
  // if no token is  in allowance or AttacoinAmount is larger than the allowance they set , it should revert  
// string memory name, string memory symbol, uint8 decimals, uint256 cap, uint256 rate ,address owner ,  IERC20 token
   function createNewToken(string calldata name, string calldata symbol, uint8 decimals, uint256  toPayAtaa, uint256 price)
    external isOrg(msg.sender) returns( address ) {
     // max total supply " hard cap " = AttacoinAmount * rate
     // should call allowance function to  see how much token in allowance and compare it with  
     // pass msg.sender as the owner parm in allowance function
     // contract should call burnFrom function to burn atta coin first and create the new cntract 

     require(attaToken.allowance(msg.sender, address(this)) >= toPayAtaa, "More Funds are needed.");
     // this should be a modefier in my opnion 
     // moved to registeration contract **** require(clients[msg.sender].status == Authorization.approved, "Not authorized to create new tokens.");

  uint256 cap = toPayAtaa.mul(price);

require(_tokenBurn(  msg.sender, toPayAtaa), "can't burn token, please check that the factory contract allowence"); 
     address T = address(new NewToken(name, symbol, decimals, cap, price , msg.sender,attaToken,YgAdmins));
    // clients[msg.sender].ownedTokens.push(T);
     newTokens.push(T);
     return T;

    }

    // TODO: we need to find a way to handel the named token that sent to admin account
   function exchangeToken( address tokentobuy , address tokenToSell , uint256 amount, address sender)
    external returns(bool){

     require(attaToken.allowance(sender, address(this)) >= amount, "More Funds are needed.");

    return true;
   }


// function _sendTokenToAdmin(address tokenAddress, uint256 amount) internal returns bool{

