function sendTokenToFactory(NewToken tokenToSell  , uint256 amount) external returns (bool){
         require(tokenToSell.allowance(msg.sender, address(this)) >= amount, "More Funds are needed.");

    tokenToSell.transfer(owner,amount);
    uint256 rate = tokenToSell.rate();
 require(   _mintAttaCoin(msg.sender,amount.div(rate)),"couldn't mint atta coin");
    return true;
}
function _tokenBurn( address sender,uint256  toPayAtaa ) internal returns (bool){
     attaToken.burnFrom(msg.sender, toPayAtaa);
     return true;

}

     function getAllTokenContracts() public view returns (address[] memory) {
      return newTokens;
   }

   function _mintAttaCoin(address beneficiary, uint256 amount) internal returns (bool){
       attaToken.mint(beneficiary,  amount);
       return true;
   } 
